   "source": [
    "Avocado: Comparison of all Regression  Models (R)\n",
    "## Author: Kavita Khandelwal\n",
    "\n",
    "\n",
    "\n",
    "## 1. Introduction\n",
    "This data represents weekly 2018 retail scan data for National retail volume (units) and price. Retail scan data comes directly from retailers’ cash registers based on actual retail sales of Hass avocados. Starting in 2013, the data reflects an expanded, multi-outlet retail data set. Multi-outlet reporting includes an aggregation of the following channels: grocery, mass, club, drug, dollar and military. The Average Price (of avocados) in the table reflects a per unit (per avocado) cost, even when multiple units (avocados) are sold in bags. The Product Lookup codes (PLU’s) in the table are only for Hass avocados. Other varieties of avocados (e.g. greenskins) are not included in this table.\n",
    "\n",
    "\n",
    "## 2. Ask\n",
    "#### 2.1 Business Task\n",
    "\n",
    "Comparison of all Regression Models\n",
    "\n",
    "\n",
    "\n",
    "## 3. Prepare\n",
    "#### 3.1 Data Information\n",
    "This data was downloaded from the Hass Avocado Board website in May of 2018 & compiled into a single CSV. This is a public dataset and can be downloaded from [here](https://www.kaggle.com/neuromusic/avocado-prices).\n",
    "\n",
    "#### 3.2 Installing and Loading R Packages\n",
    "\n"
   ]
  },
