   "source": [
    "# 1. conventional type:\n",
    "# correlation\n",
    "#cor(train_conventional$AveragePrice, train_conventional$Total_Volume)\n",
    "\n",
    "\n",
    "# build linear model\n",
    "fitc <- lm(AveragePrice~Total_Volume, data=train_conventional) #Create the linear regression\n",
    "\n",
    "\n",
    "#Plot the results\n",
    "plot(x=train_conventional$Total_Volume, y= train_conventional$AveragePrice, pch = 16, col = \"#2b501c\", main= \"Average Price vs. Total Volume for Conventional Avocado\")  +\n",
    "abline(fitc) #Add a regression line\n",
    "#or\n",
    "#avocado_df %>% filter(type==\"conventional\")%>%\n",
    "  #ggplot(aes(Total_Volume, AveragePrice, color=type)) + \n",
    "  #geom_point() + \n",
    "  #geom_smooth(method=\"lm\")+ \n",
    "  #scale_color_manual(values = c(\"#2b501c\"))\n",
    "\n",
    "\n",
    "# summary of linear model\n",
    "summary(fitc)\n",
    "\n",
    "\n",
    "# R^2 value\n",
    "summary(fitc)$r.squared \n",
    "\n"
   ]
  },
