   "source": [
    "*The p-value(Pr(>|t|) for a= (age) is 4.34*e-10 or 0.000000000434. A very small value means that age is probably an excellent addition to your model.\n",
    "\n",
    "*The p-value for the b= (number of siblings) is 0.85. In other words, there’s 85% chance that this predictor is not meaningful for the regression. i.e. number of siblings=0\n",
    "\n",
    "**if  p-value(Pr(>|t|)>0.05 reject b i.e. b=0**\n",
    "\n",
    "**y= a(intercept)+b*x1(first variable)+b*x2(second variable)**"
   ]
