   "source": [
    "# 1. conventional:\n",
    "# prediction\n",
    "predc <- predict(fitc, newdata = test_conventional)\n",
    "predc\n",
    "#tail(predc)\n",
    "\n",
    "\n",
    "# compare predicted vs. actual value\n",
    "plot(test_conventional$AveragePrice, type = \"l\", lty= 1.8, col = \"red\")\n",
    "lines(predc, type = \"l\", col = \"blue\")\n",
    "\n",
    "\n",
    "# predicted plot\n",
    "plot(predc, type = \"l\", lty= 1.8, col = \"blue\")\n",
    "\n",
    "\n",
    "# finding accuracy \n",
    "#error\n",
    "error <- test_conventional$AveragePrice-predc\n",
    "MSE <- mean(error^2) # mean squared error\n",
    "# Calculate RMSE(root mean squared error)\n",
    "rmse<- sqrt(mean(error^2))\n",
    "rmse\n",
    "MSE"
   ]
