   "source": [
    "# 2. Organic type:\n",
    "\n",
    "# build linear model\n",
    "fito <- lm(AveragePrice~Total_Volume, data=train_organic) #Create the linear regression\n",
    "\n",
    "\n",
    "#Plot the results\n",
    "plot(x=train_organic$Total_Volume, y= train_organic$AveragePrice, pch = 16, col = \"#8cb575\", main= \"Average Price vs. Total Volume for Organic Avocado\")  +\n",
    "abline(fito) #Add a regression line\n",
    "#or\n",
    "#avocado_df %>% filter(type==\"conventional\")%>%\n",
    "  #ggplot(aes(Total_Volume, AveragePrice, color=type)) + \n",
    "  #geom_point() + \n",
    "  #geom_smooth(method=\"lm\")+ \n",
    "  #scale_color_manual(values = c(\"#2b501c\"))\n",
    "\n",
    "\n",
    "# summary of linear model\n",
    "summary(fito)\n",
    "\n",
    "\n",
    "\n",
    "# R^2 value\n",
    "summary(fito)$r.squared "
   ]
