    "# 2. organic:\n",
    "# prediction\n",
    "predo <- predict(fito, newdata = test_organic)\n",
    "predo\n",
    "#tail(predc)\n",
    "\n",
    "\n",
    "# compare predicted vs. actual value\n",
    "plot(test_organic$AveragePrice, type = \"l\", lty= 1.8, col = \"red\")\n",
    "lines(predo, type = \"l\", col = \"blue\")\n",
    "\n",
    "\n",
    "# predicted plot\n",
    "plot(predo, type = \"l\", lty= 1.8, col = \"blue\")\n",
    "\n",
    "\n",
    "# finding accuracy \n",
    "#error\n",
    "error1 <- test_organic$AveragePrice-predo\n",
    "MSE1 <- mean(error1^2) # mean squared error\n",
    "# Calculate RMSE(root mean squared error)\n",
    "rmse1<- sqrt(mean(error1^2))\n",
    "rmse1\n",
    "MSE1\n"
   ]
