   "source": [
    "# for conventional:\n",
    "#fit a tree based on training data\n",
    "tree_modelc = tree(AveragePrice~Total_Volume, train_conventional) \n",
    "# or\n",
    "#tree_modelc = tree(AveragePrice~Total_Volume, train_conventional)\n",
    "tree_modelc\n",
    "summary(tree_modelc)\n",
    "\n",
    "\n",
    "plot(tree_modelc)\n",
    "text(tree_modelc, pretty = 0)\n",
    "\n",
    "\n",
    "# check how model is doing for testing data.\n",
    "tree_predc <- predict(tree_modelc, test_conventional)\n",
    "#tree_predc\n",
    "\n",
    "# mean squred error\n",
    "MSE <- mean((tree_predc - test_conventional$AveragePrice)^2)\n",
    "RMSE <- sqrt(MSE) # Root mean squared error\n",
    "\n",
    "MSE\n",
    "RMSE\n"
   ]
