   "source": [
    "# cross validation for pruning the tree\n",
    "cv_treec = cv.tree(tree_modelc)\n",
    "cv_treec\n",
    "names(cv_treec)\n",
    "\n",
    "plot(cv_treec$size,\n",
    "    cv_treec$dev,\n",
    "    type = \"b\",\n",
    "    xlab=\"Tree Size\", \n",
    "    ylab= \"MSE\")\n",
    "\n",
    "\n",
    "\n",
    "which.min(cv_treec$dev)\n",
    "cv_treec$size[1]\n",
    "\n",
    "\n",
    "# prune the tree size= 3(take 5 but already done in decision \n",
    "#tree above but size = 5 min MSE. for changing result taking 3)\n",
    "pruned_modelc <- prune.tree(tree_modelc, best = 3)\n",
    "\n",
    "\n",
    "plot(pruned_modelc)\n",
    "text(pruned_modelc)\n",
    "\n",
    "# check the accuracy of the model using testing data\n",
    "prunetree_predc <- predict(pruned_modelc, test_conventional)\n",
    "\n",
    "# mean squred error\n",
    "MSE <- mean((prunetree_predc - test_conventional$AveragePrice)^2)\n",
    "RMSE <- sqrt(MSE) # Root mean squared error\n",
    "\n",
    "MSE\n",
    "RMSE"
   ]
  },
