   "source": [
    "**The smaller RMSE that indicates the better the model. R^2 value near to 1 is good.**\n",
    "\n",
    "**For conventional type avocado:**\n",
    "> **RMSE=0.31**\n",
    "\n",
    "> **MSE =0.09**\n",
    "\n",
    "**So we will take size=5 because we get RMSE=0.30 (<.31) so reject prune method and accept decision tree without prune.**"
