   "source": [
    "# for Organic:\n",
    "#fit a tree based on training data\n",
    "tree_modelo = tree(AveragePrice~Total_Volume, train_organic) \n",
    "\n",
    "#tree_modelo\n",
    "summary(tree_modelo)\n",
    "\n",
    "\n",
    "plot(tree_modelo)\n",
    "text(tree_modelo, pretty = 0)\n",
    "\n",
    "\n",
    "# check how model is doing for testing data.\n",
    "tree_predo <- predict(tree_modelo, test_organic)\n",
    "#tree_predc\n",
    "\n",
    "# mean squred error\n",
    "MSE <- mean((tree_predo - test_organic$AveragePrice)^2)\n",
    "RMSE <- sqrt(MSE) # Root mean squared error\n",
    "\n",
    "MSE\n",
    "RMSE"
   ]
  },
