    "# cross validation for pruning the tree\n",
    "cv_treeo = cv.tree(tree_modelo)\n",
    "cv_treeo\n",
    "names(cv_treeo)\n",
    "\n",
    "plot(cv_treeo$size,\n",
    "    cv_treeo$dev,\n",
    "    type = \"b\",\n",
    "    xlab=\"Tree Size\", \n",
    "    ylab= \"MSE\")\n",
    "\n",
    "\n",
    "\n",
    "which.min(cv_treeo$dev)\n",
    "cv_treeo$size[1]\n",
    "\n",
    "\n",
    "# prune the tree size= 2(take 2 but already done in decision \n",
    "#tree above but size = 2 min MSE. tree size= 1 is showing error)\n",
    "pruned_modelo <- prune.tree(tree_modelo, best = 2)\n",
    "\n",
    "\n",
    "plot(pruned_modelo)\n",
    "text(pruned_modelo)\n",
    "\n",
    "# check the accuracy of the model using testing data\n",
    "prunetree_predo <- predict(pruned_modelo, test_organic)\n",
    "\n",
    "# mean squred error\n",
    "MSE <- mean((prunetree_predo - test_organic$AveragePrice)^2)\n",
    "RMSE <- sqrt(MSE) # Root mean squared error\n",
    "\n",
    "MSE\n",
    "RMSE"
   ]
