   "source": [
    "#**Fitting the Random Forest**\n",
    "rf_o <- randomForest(AveragePrice~Total_Volume, train_organic)\n",
    "rf_o \n",
    "attributes(rf_o)\n",
    "\n",
    "\n",
    "\n",
    "# Plotting the Error vs Number of Trees Graph.\n",
    "plot(rf_o)\n",
    "\n",
    "\n",
    "p2 <- predict(rf_o, test_organic)\n",
    "\n",
    "\n",
    "# mean squred error\n",
    "MSE <- mean((p2 - test_organic$AveragePrice)^2)\n",
    "RMSE <- sqrt(MSE) # Root mean squared error or rmse = caret::RMSE(test_organic$AveragePrice, p2)\n",
    "#https://www.datatechnotes.com/2020/10/knn-regresion-example-in-r.html\n",
    "#mse = mean((test_y - pred_y)^2)\n",
    "#mae = caret::MAE(test_y, pred_y)\n",
    "#rmse = caret::RMSE(test_y, pred_y)\n",
    "\n",
    "#cat(\"MSE: \", mse, \"MAE: \", mae, \" RMSE: \", rmse)\n",
    "\n",
    "\n",
    "MSE\n",
    "RMSE\n",
    "\n",
    "\n",
    "#oob.err[mtry] = rf_o$mse[400] \n",
    "#oob.err\n",
    "\n"
   ]
  },
