   "source": [
    "# for regression model\n",
    "lm1 <- train(AveragePrice~Total_Volume, train_organic, method = \"lm\", tuneLength = 10,\n",
    "                 trControl = trainControl(method = \"cv\"))\n",
    "lm1$finalModel\n",
    "summary(lm1$finalModel)$r.squared\n",
    "lm1\n",
    "lm1$results\n",
    "summary(lm1)\n",
    "plot(lm1$finalModel)\n",
    "attributes(lm1)\n",
    "\n",
    "\n",
    "\n",
    "\n",
    "pred<- predict(lm1, test_organic)\n",
    "RMSE <- RMSE(pred, test_organic$AveragePrice)\n",
    "RMSE\n",
    "\n"
   ]
  },
