    "attributes(rf1)\n",
    "\n",
    "\n",
    "\n",
    "pred<- predict(rf1$finalModel, test_organic)\n",
    "RMSE <- RMSE(pred, test_organic$AveragePrice)\n",
    "RMSE"
   ]
