   "source": [
    "tc <- trainControl(method=\"cv\", number = 10)\n",
    "\n",
    "knn_modelc <- train(AveragePrice~Total_Volume, train_conventional, method = \"knn\", trControl = tc) \n",
    "\n",
    "knn_modelc\n",
    "plot(knn_modelc)\n",
    "#varImp(knn_modelc)\n",
    "\n",
    "predc <- predict(knn_modelc, test_conventional)\n",
    "\n",
    "\n",
    "# mean squred error\n",
    "mse = mean((test_conventional$AveragePrice - predc)^2)\n",
    "mae = caret::MAE(test_conventional$AveragePrice, predc)\n",
    "rmse = caret::RMSE(test_conventional$AveragePrice, predc) #or RMSE <- RMSE(predc, test_conventional$AveragePrice)\n",
    "\n",
    "cat(\"MSE: \", mse, \"MAE: \", mae, \" RMSE: \", rmse)"
   ]
  },
