   "source": [
    "tc <- trainControl(method=\"cv\", number = 10)\n",
    "\n",
    "knn_modelo <- train(AveragePrice~Total_Volume, train_organic, method = \"knn\", trControl = tc) \n",
    "\n",
    "knn_modelo\n",
    "attributes(knn_modelo)\n",
    "plot(knn_modelo)\n",
    "#varImp(knn_modelc)\n",
    "\n",
    "predo <- predict(knn_modelo, test_organic)\n",
    "\n",
    "\n",
    "# mean squred error\n",
    "mse = mean((test_organic$AveragePrice - predo)^2)\n",
    "mae = caret::MAE(test_organic$AveragePrice, predo)\n",
    "rmse = caret::RMSE(test_organic$AveragePrice, predo) #or RMSE <- RMSE(predc, test_conventional$AveragePrice)\n",
    "\n",
    "cat(\"MSE: \", mse, \"MAE: \", mae, \" RMSE: \", rmse)\n",
    "\n"
   ]
