    "# https://www.datatechnotes.com/2020/08/regression-example-with-xgboost-in-r.html\n",
    "#Preparing the data\n",
    "#After loading the dataset, first, we'll split them into the train and test parts, \n",
    "#and extract x-input and y-label parts. The xgboost uses matrix data so that we need to \n",
    "#convert our data into the xgb matrix type.\n",
    "\n",
    "train_x = data.matrix(train_conventional$Total_Volume)\n",
    "train_y = train_conventional$AveragePrice\n",
    "#or we can write like this but not for this dataset because we have only 2 variable here.\n",
    "#train_x = data.matrix(train[, -13])\n",
    "#train_y = train[,13]\n",
    "\n",
    "\n",
    "test_x = data.matrix(test_conventional$Total_Volume)\n",
    "test_y = test_conventional$AveragePrice\n",
    "\n",
    "\n",
    "#convert our data into the xgb matrix type.\n",
    "xgb_train = xgb.DMatrix(data = train_x, label = train_y)\n",
    "xgb_test = xgb.DMatrix(data = test_x, label = test_y)\n"
   ]
  },
