    "train_x = data.matrix(train_organic$Total_Volume)\n",
    "train_y = train_organic$AveragePrice\n",
    "#or we can write like this but not for this dataset because we have only 2 variable here.\n",
    "#train_x = data.matrix(train[, -13])\n",
    "#train_y = train[,13]\n",
    "\n",
    "\n",
    "test_x = data.matrix(test_organic$Total_Volume)\n",
    "test_y = test_organic$AveragePrice\n",
    "\n",
    "\n",
    "#convert our data into the xgb matrix type.\n",
    "xgb_train = xgb.DMatrix(data = train_x, label = train_y)\n",
    "xgb_test = xgb.DMatrix(data = test_x, label = test_y)\n",
    "\n",
    "\n",
    "\n",
    "xgbo = xgboost(data = xgb_train, max.depth = 2, nrounds = 50)\n",
    "print(xgbo)\n",
    "\n",
    "\n",
    "#we'll predict the x test data with the xgbc model.\n",
    "\n",
    "pred_y = predict(xgbo, xgb_test)\n",
    "\n",
    "\n",
    "# error\n",
    "mse = mean((test_y - pred_y)^2)\n",
    "mae = caret::MAE(test_y, pred_y)\n",
    "rmse = caret::RMSE(test_y, pred_y)\n",
    "\n",
    "cat(\"MSE: \", mse, \"MAE: \", mae, \" RMSE: \", rmse)\n",
    "\n",
    "\n",
    "#plot\n",
    "plot(test_organic$AveragePrice, col = \"red\", type = \"l\")\n",
    "lines(pred_y, col = \"blue\", type = \"l\")\n",
    "# or\n",
    "#x = 1:length(test_conventional$AveragePrice)\n",
    "#plot(x, test_y, col = \"red\", type = \"l\")\n",
    "#lines(x, pred_y, col = \"blue\", type = \"l\")\n",
    "#legend(x = 1, y = 38,  legend = c(\"original test_y\", \"predicted test_y\"), \n",
    "       #col = c(\"red\", \"blue\"), box.lty = 1, cex = 0.8, lty = c(1, 1))\n",
    "\n"
   ]
