   "source": [
    "#https://www.youtube.com/watch?v=DBApaR2mTg0\n",
    "set.seed(123)\n",
    "model_c <- svm(AveragePrice~Total_Volume, data=train_conventional, type= \"eps-regression\") #Create the linear regression\n",
    "\n",
    "\n",
    "# prediction\n",
    "pred_c <- predict(model_c, test_conventional)\n",
    "\n",
    "# compare predicted vs. actual value\n",
    "plot(test_conventional$AveragePrice, type = \"l\", lty= 1.8, col = \"red\")\n",
    "lines(pred_c, type = \"l\", col = \"blue\")\n",
    "\n",
    "\n",
    "# finding accuracy \n",
    "#error\n",
    "error <- test_conventional$AveragePrice-pred_c\n",
    "# Calculate RMSE(root mean squared error)\n",
    "rmse<- sqrt(mean(error^2))\n",
    "rmse\n",
    "\n",
    "#or rmse<- RMSE(test_conventional$AveragePrice, pred_c) use \"caret\" package\n"
   ]
