   "source": [
    "**For conventional Avocado: Support Vector Regression**\n",
    "> **RMSE: 0.314619836883457**\n",
    "\n",
    "**But can we do better ?**\n",
    "\n",
    "**Step: Tuning your support vector regression model**\n",
    "\n",
    "In order to improve the performance of the support vector regression we will need to select the best parameters for the model.\n",
    "\n",
    "but it took a default value of 0.1.  There is also a cost parameter which we can change to avoid overfitting.\n",
    "\n",
    "The process of choosing these parameters is called hyperparameter optimization, or model selection.\n",
    "\n",
    "The standard way of doing it is by doing a grid search. It means we will train a lot of models for the different couples of ϵ and cost, and choose the best one."
   ]
  },
  {
   "cell_type": "markdown",
   "id": "fcffc0bf",
   "metadata": {
    "papermill": {
