     "status": "completed"
    },
    "tags": []
   },
   "source": [
    "There is two important points in the code below:\n",
    "\n",
    " we use the tune method to train models with ϵ=0,0.1,0.2,...,1  and cost = 2^2,2^3,2^4,...,2^9 which means it will train  11(total ϵ value)*8(total no. of cost)=88 models (it can take a long time)\n",
    "the tuneResult returns the MSE, don't forget to convert it to RMSE before comparing the value to our previous model.\n",
    "The last line plot the result of the grid search:"
   ]
