   "source": [
    "# perform a grid search\n",
    "set.seed(123)\n",
    "tuneResult_c <- tune(svm, AveragePrice~Total_Volume, data=train_conventional,\n",
    "ranges = list(epsilon = seq(0,1,0.1), cost = 2^(2:9))\n",
    ")\n",
    "print(tuneResult_c)\n",
    "# Draw the tuning graph\n",
    "plot(tuneResult_c)"
   ]
  },
