   "source": [
    "tunedModel <- tuneResult_c$best.model\n",
    "tunedModel\n",
    "tunedModelY <- predict(tunedModel, test_conventional)\n",
    " \n",
    "error <- test_conventional$AveragePrice - tunedModelY\n",
    " \n",
    "# this value can be different on your computer\n",
    "# because the tune method  randomly shuffles the data\n",
    "rmse <- RMSE(test_conventional$AveragePrice, tunedModelY)  \n",
    "print(rmse)"
   ]
  },
