    "# perform a grid search\n",
    "set.seed(123)\n",
    "tuneResult <- tune(svm, AveragePrice~Total_Volume, data=train_organic,\n",
    "ranges = list(epsilon = seq(0,1,0.1), cost = 2^(2:9)))\n",
    "print(tuneResult)\n",
    "# Draw the tuning graph\n",
    "plot(tuneResult)"
   ]
